// SeriesCard.js
import React from 'react';
import './SeriesCard.css';

const SeriesCard = ({ series, onSelect }) => {
  return (
    <div className="card" onClick={() => onSelect(series.id)}>
      <h3>{series.name}</h3>
    </div>
  );
};

export default SeriesCard;
